  return {
    products: state.products,
    hairstyles: state.hairstyles,
    isPending: state.isPending
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    onRequestPosts: () => dispatch(requestPosts())
  }
}


class App extends Component {


  render() {

    return (
      <div className="App">
        {console.log(this.props)}
      </div>
    );
  }
}

